import "./App.css";
import { useState, useEffect } from "react";

import "bootstrap/dist/css/bootstrap.min.css";

import Table from "react-bootstrap/Table";

import TableRows from "./components/TableRows";
import TableHead from "./components/TableHead";

import Filters from "./components/Filters";
import StartProcess from "./components/StartProcess";

function App() {
  const details = [
    {
      server: "server1",
      process: ["p1", "p2"],
    },
    {
      server: "server2",
      process: ["p1", "p2", "p3"],
    },
    {
      server: "server3",
      process: ["p1", "p4"],
    },
  ];
  const runningProcesses = [
    {
      startTime: "04/19/17 04:34:22 +0000",
      serverName: "CyberDust.internal",
      processName: "query_tests",
      instanceID: 114,
      Status: "10",
      serverId: 1,
      processId: 1,
      status: "Completed",
    },
    {
      startTime: "05/23/17 04:34:22 +1200",
      serverName: "Skynet.dedicated",
      processName: "transaction_checks",
      instanceID: 4450,
      Status: "60",
      serverId: 2,
      processId: 2,
      status: "Failed",
    },
    {
      startTime: "14/06/17 04:34:22 +0000",
      serverName: "Perplexed",
      processName: "rollback_execute",
      instanceID: 8901,
      Status: "30",
      serverId: 3,
      processId: 3,
      status: "In Progress",
    },
    {
      startTime: "04/23/17 04:34:22 +1930",
      serverName: "Grimlock.lantern",
      processName: "deadlock_detect",
      instanceID: 1230,
      Status: "40",
      serverId: 4,
      processId: 4,
      status: "Failed",
    },
    {
      startTime: "04/23/17 04:34:22 +0800",
      serverName: "CyberDust.internal",
      processName: "data_parser",
      instanceID: 240,
      Status: "90",
      serverId: 5,
      processId: 5,
      status: "Completed",
    },
  ];

  //fetched from database
  const completedProcesses = [
    {
      startTime: "04/19/17 04:34:22 +0000",
      serverName: "CyberDust.domain",
      processName: "query_tests",
      instanceID: 1301,
      Status: "Completed",
      serverId: 6,
      processId: 6,
      status: "Completed",
    },
    {
      startTime: "05/23/17 04:34:22 +1200",
      serverName: "NoNameServer",
      processName: "transaction_checks",
      instanceID: 2002,
      Status: "Failed",
      serverId: 7,
      processId: 7,
      status: "Completed",
    },
    {
      startTime: "14/06/17 04:34:22 +0000",
      serverName: "Perplexed",
      processName: "rollback_execute",
      instanceID: 2302,
      Status: "Completed",
      serverId: 8,
      processId: 8,
      status: "Completed",
    },
    {
      startTime: "04/23/17 04:34:22 +1930",
      serverName: "Grimlock.lantern",
      processName: "deadlock_detect",
      instanceID: 2221,
      Status: "Completed",
      serverId: 9,
      processId: 9,
      status: "Completed",
    },
  ];

  const [processes, setProcesses] = useState([]);
  const tableHeadDetails = [
    "Start Time",
    "Server Name",
    "Process Name",
    "Instance ID",
    "Status",
    "Action",
    "Details",
  ];
  // Filters
  const [filters, setFilters] = useState({
    serverId: 0,
    processId: 0,
    processName: "",
    serverName: "",
    status: "",
  });

  const filterProcesses = (
    processId,
    serverId,
    processName,
    serverName,
    status
  ) => {
    setFilters({
      ...filters,
      processId: processId === "" ? 0 : parseInt(processId),
      serverId: serverId === "" ? 0 : parseInt(serverId),
      processName: processName === "" ? "" : processName,
      serverName: serverName === "" ? "" : serverName,
      status: status === "" ? "" : status,
    });
  };

  return (
    <div className="container">
      <h1 style={{ textAlign: "center" }}> RTB Dashboard </h1>
      <StartProcess details={details} />

      <Filters
        filterProcesses={filterProcesses}
        processes={runningProcesses.concat(completedProcesses)}
      />
      <Table responsive striped bordered hover className="text-center">
        <TableHead details={tableHeadDetails} />
        <TableRows
          processes={runningProcesses.concat(completedProcesses)}
          running={true}
          filters={filters}
        />
        {/* <br /> */}
        {/* <td className="w-100 p-3" colSpan="8">
          <br />
          <h6 className="text-center">Completed Prcoesses</h6>
        </td>
        <TableRows processes={completedProcesses} running={false} /> */}
      </Table>
    </div>
  );
}

export default App;
